//import Frontend from "./Frontend";
import React from "react";
import './App.css';


class App extends React.Component {

  // Constructor 
  constructor(props) {
      super(props);

      this.state = {
          items: [],
          DataisLoaded: false
      };
  }

  // ComponentDidMount is used to
  // execute the code 
  componentDidMount() {
      fetch(
"https://https://api.documenu.com/v2/restaurant/4072702673999819?key=82dbeaac7b3078a26ab28e0736ecf8ee")
          .then((res) => res.json())
          .then((json) => {
              this.setState({
                  items: json,
                  DataisLoaded: true
              });
          })
  }
  render() {
      const { DataisLoaded, items } = this.state;
      if (!DataisLoaded) return <div>
          <h1> Pleses wait some time.... </h1> </div> ;

      return (
      <div className = "App">
          <h1> Fetch data from an api in react </h1>  {
              items.map((item) => ( 
              <ol key = { item.id } >
                  restaurant_name: { item.restaurantname }
                  </ol>
              ))
          }
      </div>
  );
}
}

export default App;
